"announcement": "PROMO: 3 GREETING CARDS FOR $12!  Use code 3FOR12 at checkout!\r\n\r\nTo learn more about us and all you need to know about letterpress, visit our website at www.violetpressandpaper.com\r\n\r\nVP&P specializes in design using old-fashioned metal type, borders and vintage printing cuts.  Part of the fun of letterpress printing is searching through antique stores, flea markets, etc. for old type, advertising blocks and other antique items.  Those are altered and re-purposed to bring you a modern card/stationery/invite.  We also use modern polymer printing plates to transfer our original design work, drawings and calligraphy.\r\n\r\nI am happy to print your designs or help you with design if you have something specific in mind.  The most important part is bringing your vision to life!  Please enjoy my shop and message me with any questions.\r\n\r\nThanks so much!",
