"sale_message": "Thank you for purchasing my design! I&#39;m so happy that you chose it!\r\nIn several minutes an email with download links will be sent to the e-mail address associated with your Etsy account. It will happen immediately after you complete your purchase! No waiting!\r\n\r\nIf you purchased 2 or more items in my shop you will be able to pick 1 FREE set from  download landing page. I have BUY 2 GET 1 FREE offer in my shop at the moment :)\r\nYou get 1 FREE set for each 2 items you buy from my shop!!!!!!\r\n\r\nWhen you open your download landing page scroll down to the table at the bottom of the screen. There you can pick which files you want. It will also show you how many tokens you have left.\r\nEnjoy!",
"digital_sale_message": null,
