"login_name": "GraphicMarket",
"accepts_custom_requests": false,
"policy_welcome": "Dear Customer\r\nAt GraphicMarket, you will find a variety of digital collage sheets,clip-art, scrap book element sets or whatever your graphic needs may be. Each purchased sheet will be emailed to you as a high resolution JPEG and EPS file.\r\nPlease have basic knowledge of Photoshop(for jpg) or Illustrator(for eps) before purchasing templates so there will be no disappointment, thank you!\r\nUnfortunately I don&#39;t do changes to the template or card that you purchased. This includes changing text and colour. But please send me an email with your wishes , it may take up to 48 hours, but usually I&#39;m quick ;)",
"policy_payment": "Paypal",
"policy_shipping": "No shipping, items are virtual products only. You will receive download links usually within 24 hours (most of the time a lot quicker) but sometimes up to 48 hours on weekends. Thank you for your order. Please contact me if you have any queries.\r\n",
"policy_refunds": "Due to the nature of the product no refunds can be offered.\r\n\r\nI will assist you with any concerns or problems you have with the design. I will work hard to make sure you are happy with the finished product.",
"policy_additional": "You are responsible for downloading the images that I send to your email, onto your computer/device. I will resend the images only 2 times, within 24 hours of purchase. If you need them sent to a Facebook account, a different email or somewhere else, please let me know in an email or conversation. Please make sure you have an email that will accept digital file attachments.\r\n\r\nLicense information.\r\nPlease note my commercial use licenses are designed for SMALL craft businesses where you are hand making items or hand finishing printed items for sale in craft markets, craft sites like etsy and similar. Extended licenses are available for other business use. For license to reproduce on to mediums other than paper please contact me for information. Images are for items YOU hand make and sell to the end customer and not made by a third party for sale or for wholesale without permission. Please contact GraphicMarket for extra license fees.\r\n\r\nMost of my items are design resources which means they CANNOT be printed and sold as is but used to create your own designs.\r\n\r\nYou may not use any of my images in banners, logos, avatars, web use or for branding, resale of images to other businesses without extra licensing. Please contact me to discuss any of these uses. You may not claim any of my images as your own or misrepresent them.\r\n\r\nCredit for images and pattern Copyright GraphicMarket\r\n\r\nAny image used on your product and shown online must be protected with a watermark.\r\n\r\nOk for personal use, photographers, personalised photo cards, scrap for hire.\r\n\r\nThis license also allows them to be used in &#39;personalised&#39; invites or announcements with no photo content supplied either printed or digital.\r\n\r\nNot for redistribution as is or use in templates for sale. They cannot be used in printables or digital kits or other digital products such as generic invites supplied digitally.\r\n\r\nOk for your own personal non commercial blogs and websites. There is an extra fee for use on your own small business websites. Ask me for license details.\r\n\r\nOK for small quantity hand made craft use such as magnets, mirrors, hand made cards and similar. Small quantity means about 20 to 40 items. Over that you need extended licensing.\r\n\r\nOther uses please contact me.\r\n",
