"description": "Original and unique! Exquisite art that you can eat off too! \n\nThe quintessential gift for your friends with discriminating taste.\n\nListing is for one 10 inch melamine plate made to order - and made for a good time! Order one, or two, or as many as you like. Also shown here are other designs that can add to a set - listed separately.\n\nPlates feature sweet and original designs sourced from antique and vintage artwork that I enhance, alter, and reproduce. These food safe, dishwasher safe, scratch and fade resistant plates have designs directly related to my âDictionary Page - Art Printsâ at my Etsy shop, FauxKiss, (please visit, http://fauxkiss.etsy.com).\n\nVirtually indestructible, melamine&#39;s sturdy construction is a natural for entertaining at the beach house, cabin, yacht, backyard barbeques, patio place settings or every day use indoors. These plates are superior quality and also make distinctive wall or shelf art!\n\nWhen your plate is created the image actually becomes part of the melamine plate! Not a decal. The end result is a sumptuous plate that is completely safe to eat from and can be used every day, or displayed as a special keepsake. \n\n100% kid friendly and food safe, plates are BPA free, dishwasher safe, and break resistant. Not for microwave or oven.\n\nSHIPPING: Each melamine plate is made to order. Please see my Policies page for important shipping details; http://www.etsy.com/shop/TheMadPlatters/policy \n\nWhite plate view shows the actual plate curves and contours. \n\nSee more plates and platters at http://TheMadPlatters.etsy.com. Thanks for looking!",
