"vacation_message": "Hello awesome Etsy customers.  Your business and fabulous feedback is greatly appreciated!  We sold our home, the studio is in storage, and we are in temporary housing. There&#39;s been delays and our timetable is uncertain. So very sorry for any disappointment !  Thank you for your Patience. ",
"sale_message": "Thank you for your purchase! \r\n\r\nA multiple plate order may have EXCESS SHIPPING FEES. Please excuse that shipping fees for certain quantities are unavoidably overcharged. Any excess shipping charges will be refunded the first thing upon processing your order. Shipping costs are listed on my policies page.  \r\n\r\nPlates are made to order. Total Production and delivery (USA) varies for location but is typically around 10 to 15 business days.  \r\n\r\nShipments cannot be delivered to PO BOX ADDRESSES. The address on your Etsy invoice for your purchase will be the shipping address for your package unless otherwise requested. If shipping address is an APARTMENT please make arrangements for the delivery of this large box.\r\n\r\nYour business is appreciated. Please don&#39;t hesitate to contact me at TheMadPlatters.etsy.com with any questions, comments or concerns.\r\n\r\nCANADA: Canada Shipping takes longer and can take up to 30 days. \r\nCANADA: Please note there is no delivery tracking for shipments to Canada unless requested for additional shipping fee.\r\n\r\nHAWAII and ALASKA: \r\nShipping is more expensive to these destinations and Etsy does not permit shops to list shipping fees to these destinations separately. I will need additional payment for the shipping fees that are required to ship to Hawaii or Alaska. Your order will be held until the invoice is paid (or you may cancel your order).\r\n\r\nMany Thanks,\r\nJean and Kit Cody\r\nhttp://TheMadPlatters.etsy.com",
"digital_sale_message": null,
"last_updated_tsz": 1432142076,
"listing_active_count": 447,
"login_name": "TheMadPlatters",
"accepts_custom_requests": false,
"policy_welcome": "We are  delighted to have found Etsy and I hope you are too! Your taking the time to familiarize yourself with our shop policies is appreciated.  \r\n\r\nNEW! Plates available in two sizes: 8 inch and 10 inch.  \r\n\r\nPlates are best in person! It seems impossible to capture the details of the artwork for the web view. Please note that the view online will vary between different monitors and the view on a monitor differs some from the plate in person. \r\n\r\nThe Mad Platters is our 2nd Etsy shop.  Many of my plates and platters feature designs directly related to my Dictionary Page - Art Prints found at http://fauxkiss.etsy.com  \r\n\r\nThank you for visiting!\r\n\r\nPLEASE NOTE: We cannot accept custom orders at this time.\r\n\r\nClick here to return to shop,  http://TheMadPlatters.etsy.com",
"policy_payment": "Order is not processed until payment has been received.\r\n\r\n",
"policy_shipping": "DELIVERY TIME: Total production and delivery is typically around 10 business days but can be 15 business days. Delivery time varies with destination. CANADA shipping takes longer.\r\n\r\nIMPORTANT NOTICE:  UPS WILL NOT DELIVER to PO BOX addresses. The address on your Etsy invoice for your purchase will be the shipping address for your package, unless otherwise requested. \r\n\r\nSHIPPING FEES: Please excuse that certain quantities are unavoidably overcharged.   If there are excess shipping fees on your order, EXCESS SHIPPING CHARGES WILL BE REFUNDED THE FIRST THING UPON PROCESSING YOUR ORDER.\r\n     \r\nPlates are quite heavy and are professionally packed and shipped with care which is costly. Please note that I never add shipping or handling charges on top the packer & carrier shipping fees.\r\n\r\nTRACKING: US Domestic Plate orders ship UPS or UPS Mail Innovations with delivery tracking (Tracking is in continental US only). \r\n\r\nCANADA: Please note there is no delivery tracking for Canada shipments.  It is expensive but available upon request.  Please purchase tracking with insurance if you have problems with deliveries getting lost.\r\n\r\nHAWAII and ALASKA: Shipping is more expensive and Etsy does not permit me to list shipping fees to these destinations separately. I will need to REQUEST those shipping fees not yet paid to ship your purchase. Your ORDER WILL BE HELD until the balance of shipping is paid (or you may CANCEL your order).\r\n\r\nSo sorry, presently, we can only ship to USA and CANADA .\r\n_____________________________________________________________\r\n\r\nShipping fee varies with number of plates and platters ordered. If there is excess shipping charge on your order, IT WILL BE REFUNDED PROMPTLY.\r\n\r\nPLATE SHIPPING FEES:\r\nNUMBER of PLATES........US SHIPPING\r\nSingle Plate ..............................$5.95\r\n2 plates......................................$9.95\r\n3 plates......................................$11.25\r\n4 plates......................................$12.95\r\n5 plates......................................$12.95\r\n6  - 11 plates.............................$15.95\r\n12 - 17 plates.............................$18.95\r\n18 - 23 plates.............................$21.95\r\n24 - 29 plates.............................$27.95\r\n\r\nPLATTER SHIPPING FEES:\r\nNUMBER of PLATES........US SHIPPING\r\nSingle Platter.............................$9.95\r\n2 platters....................................$11.25\r\n3 platters....................................$12.95\r\n4 platters....................................$12.95",
"policy_refunds": "We want you to be happy with your purchase.  \r\n\r\nEACH PLATE in my shop IS CUSTOM MADE just for you when your order is placed.  Plates and platters being CUSTOM MADE can receive refunds ONLY if there is a defect in the plate. Please notify me as soon as possible if your plate is defective.  \r\n\r\nIf I&#39;ve missed something in my item description and you have question, please notify me and feel free to ask as many questions as you like about the item you wish to buy before placing an order. \r\n\r\nUNCLAIMED/ UNDELIVERABLE packages: \r\nYou will be expected to cover additional shipping costs for re-shipping or shipping to the correct address. ",
"policy_additional": "PLEASE NOTE: We cannot accept custom orders at this time.\r\n\r\nMy plates are made to order by a third party in the USA.\r\n\r\nYOUR AND MY MONITORS: Plates are best when viewed in person. Please note that the view online will vary between different monitors and THE VIEW ON A MONITOR DIFFERS FROM THE PLATE IN PERSON. This is unavoidable. 1) Some my listings look faded on my husband&#39;s monitor while 2) showing brilliant color on my calibrated monitor, and 3) if you have a wide screen monitor, the colors on your monitor will be overly saturated and/or bright. I keep my working monitor calibrated to ensure a professional working environment.\r\n\r\n",
