"policy_welcome": "Welcome to Seaside Prints. \r\nThanks for visiting our shop. We hope you find the perfect print for your special place!\r\nPlease read the shop policies thoroughly before placing an order. Feel free to convo with any questions or concerns you may have.\r\nThanks again!",
"policy_payment": "You can pay us using Paypal - You do not need a Paypal account to actually use Paypal - You can create a Paypal account if you want to and you do not already have one, or you can simply use Paypal to pay with a credit card, debit card, or even a personal check without creating a Paypal account.\r\n\r\nSometimes creating a Paypal account for the first time will delay the payment going through for a few days while they verify your information.\r\n\r\nPayments using Paypal with a personal check are held by Paypal until they clear - Etsy sellers have no control over this and there is a delay before I receive that payment and therefore will take more time until your purchase is shipped.\r\n\r\nIf payment is not received within seven days, your order may be cancelled. Please contact me if you have any concerns.",
"policy_shipping": "Your print will be packaged in a clear plastic sleeve, with a cardboard insert to protect the print while being shipped.\r\n\r\nOrders will be shiped to the adress that you supplied through ETSY, so please make sure that this address is correct before placing an order.\r\n\r\nPlease allow up to three/ five  business days (Monday through Friday not including holidays) for your order to ship once payment has cleared.\r\nCustom orders may take longer.\r\n\r\nWe ship worldwide through REGISTERED airmail service ( INCLUDING TRACKING NUMBER)\r\n\r\nDelivery time takes about:\r\nEurope : 4-8 bussines days\r\nUnited States : about 10-15 working days\r\nWorldwide: 15 bussines days\r\n\r\nBefore/After Christmas there may be some delay due to busy mail services. \r\n\r\nIf you need it faster just let me know and we&#39;ll talk about Priority rates. I can also add insurance and delivery confirmation.\r\n\r\nWe ship all orders with Correos Spain in USA , the USPS delivers our orders.\r\n\r\nPlease take note that the buyer is responsible for any duties and/or customs fees that may be incurred by their destination country.\r\n\r\nPlease if you have any question do not doubt to convo me. I will be happy to solve your doubts. Thanks and Enjoy!\r\n",
"policy_refunds": "-Returns-\r\nI do accept returns on any order. Please contact me within two weeks of receiving your package if you are looking to make a return. In order to return an item, you must ship the package back to me at your expense, and the item must arrive in good, unused condition. I will then offer a refund of the purchase price of the item (without shipping cost).\r\nPlease note that we DONT accept refunds/ exchanges in CUSTOM orders.\r\n\r\n- Lost or Damaged Packages â\r\nIf your items arrive damaged, or if your package was shipped out but never arrived, please contact me. I will work with you to come up with a solution on a case by case basis.",
