"description": "Ive got a lot of vintage prints of Octopus (take a look at my NauticalNell shop for the full range). Octopus reading a book\n\n------------------------------------------------------------\nInitial standard shipping on this item is free worldwide\n------------------------------------------------------------\n\n\nI offer three styles of prints; \n\n1. ORIGINAL DICTIONARY PRINTS \nThese are printed into genuine antiquarian dictionary pages from the 1830&#39;s. These rare and beautiful pages are of great quality and enhance the artwork fabulously. They have aged over time to a lovely mellow ivory patina and sometimes have occasional irregularities and age marks which adds to their charm. The images are positioned onto the pages so that they can be trimmed to sit perfectly in an 8 x 10inch (20x25.5cm) frame. \n\n2. REPRODUCTION DICTIONARY PRINT POSTERS\nIf you are looking for a slightly larger print, then this is perfect for you. We print an enlarged version of the image onto an A3 page along with an over-print of dictionary page text. The image is centered with a white border ready for framing and looks perfect in a 14x11inch frame\n\n3.  MOUNTED/MATTED ORIGINAL DICTIONARY PRINTS\nYour print will be mounted into an ivory coloured, high quality, precision cut bevelled edge 14x11 inch mount/matt, with a backing board. Safely wrapped in cello, and ready for framing into a standard 14x11 inch frame.\nThis option is available for our Original Dictionary Prints only, and NOT for the 14x11 inch Reproduction Dictionary Print Posters.\nThese prints come with mounts/mats, and do not come framed. \nSee image on this listing for an example.\n\n\n\nSimply select the size that you want when you order. All 8x10 inch prints are on the original dictionary pages. All 14x11 inch prints are printed onto high quality A3 art card and overprinted with dictionary page text.\n\nAll prints are sold unframed and unmounted (with no mats), unless you select to have your print mounted. Your print will not be printed onto the exact page as shown above, but it will be the same style.   We do not offer framed prints.\n\n\n\n---------------------------------\nShipping\n---------------------------------\nInitial standard shipping worldwide is free. Tracking is not available on this service. For estimated shipping times please click the &#39;Shipping & Policies&#39; tab above. \n\nUS and Canada customers have the option to upgrade shipping to Federal Express International Priority with a 2/3 day service. You can select this option on check out from inside your shopping cart.\n\nA fully tracked courier upgrade is also available for other countries. Check the shipping upgrade option on the right hand side of your shopping cart for details. This is applicable to: UK, Australia, Austria, Belguim, Denmark, France, Germany, Italy, Netherlands, Poland, Republic of Ireland, Spain, Sweden\n\n\n\n---------------------------------\nVisit my shops \n---------------------------------\nSee our full range of DottyDictionary prints here:\nhttp://www.etsy.com/shop/DottyDictionary\n\nFabFunky has my original artwork images on antiquarian dictionary pages.\nhttp://www.etsy.com/shop/FabFunky\n\nLoopyLolly has lovely art prints that are just a little bit loopy\nhttps://www.etsy.com/shop/LoopyLolly\n\nNauticalNell will help you bring summer into your home all year round with an enormous selection of coastal home style art prints\nhttps://www.etsy.com/shop/NauticalNell",
