"policy_refunds": "-Returns-\r\nI do accept returns on any order. Please contact me within two weeks of receiving your package if you are looking to make a return. In order to return an item, you must ship the package back to me at your expense, and the item must arrive in good, unused condition. I will then offer a refund of the purchase price of the item (without shipping cost).\r\nPlease note that we DONT accept refunds/ exchanges in CUSTOM orders.\r\n\r\n- Lost or Damaged Packages â\r\nIf your items arrive damaged, or if your package was shipped out but never arrived, please contact me. I will work with you to come up with a solution on a case by case basis.",
"policy_additional": "COUPON CODES\r\nÂ· The coupons will only be valid when applied upon checkout, by providing the right coupon code in the coupon box when purchasing the items. Seaside Prints reserves the right to accept coupons provided after the order is placed or shipped. \r\nÂ· Coupons are valid for a limited time only. Seaside Prints reserves the right to modify or cancel coupons at any time.\r\nÂ· If you do not purchase the items added to your Cart when the coupon is in effect, the discount will not apply.\r\nÂ· The coupon may only be used on www.seasideprints.etsy.com and in conjunction with the purchase of products shipped and sold by Seaside Prints. \r\nÂ· The promotion is limited to one coupon per customer.\r\nÂ· If you return any of the items purchased with a coupon, the coupon discount or value may be subtracted from the return credit. Applicable shipping and handling charges apply to all products.\r\nÂ· Consumer is required to pay any applicable sales tax related to the use of the coupon.\r\nÂ· Coupons are void if restricted or prohibited by law.",
