"policy_refunds": "We do not accept returns.\r\n\r\nMonitor screen colors vary. If you need to match a particular color I highly recommend ordering a printed color chart prior to placing order.\r\nListing: https://www.etsy.com/listing/179744656\r\n\r\nOur prints DO NOT arrive matted or framed. \r\n\r\nWe do understand that items can be damaged during shipping. Please notify us immediately if your print has arrived damaged and we will ship a new out the following business day.",
"policy_additional": "What size prints do you offer?\r\n\r\nWe have prints  ranging from 5x7&#39;s up to 11x14&#39;s. We print standard frame size making matting and framing easy.\r\n\r\nâ¢â¢â¢\r\n\r\nDo the prints come matte and framed?\r\n\r\nNo. The photo shown on the listing is for reference only. You will receive the print only in a protective poly sleeve, shipped in a rigid envelope.\r\n\r\nâ¢â¢â¢\r\n\r\nI need my print now! Can I get it  via email/download to print myself?\r\n\r\nYes. Please contact us prior to ordering. We can send any of our images via email for instant print, this will drop the price so please contact us first so we can create a custom discount listing for you.\r\n\r\nâ¢â¢â¢\r\n\r\nI don&#39;t like the colors on my print, they don&#39;t match my monitor; Can I return for a refund?\r\n\r\nNo. I&#39;m sorry we do not accept returns. The colors you see on screen may differ from the actual print. I try to make them match, but each monitor is different. I highly recommend purchasing a color chart if you need an exact color match.\r\nhttps://www.etsy.com/listing/179744656\r\n\r\nâ¢â¢â¢\r\n\r\nI don&#39;t see the color I need, can I give you a paint color to match?\r\n\r\nYes. Since we are printing we can match any color. Just send us a message with the paint color brand and swatch name/number.\r\n",
