"description": "Mini-octopus hanging air planters.  These make a ornament that you can hang all year! They make a great birthday, anniversary, graduation, wedding favor gift.  They are amusing and bring a bit of joy to any day. A gift for any occasion!\n\nThis item is ready to ship.  If you can&#39;t &quot;choose&quot; your color it is out of stock, please convo us and we will make it asap!\n\n Octopus mothers are called a &quot;hen.&quot;  They are insanely smart, they can make a home out of almost anything. No mother could give more to their off spring. They fiercely protect their eggs, they tenderly care for their eggs.  She never leaves the eggs to eat.  An octopus is caring, smart, fearless, playful and protective.  All qualities that make us adore our own mom&#39;s.\n\n This purchase is for one planter and air plant. This item is ready to ship. We use what healthy, gorgeous air plants that we have available.\n\nIf you can not order a color, we have run out, please convo us what color you would like.  Allow up to 3 weeks for delivery.\n\nThis little octopus are aprox 2 1/2&quot; tall and 2 1/2&quot; wide at the base.  The octopus are hand thrown in a closed form and then I pebble them with a smooth rock I found from the beach.  They are then bisque fired then glazed, so there will be a natural variation in them.  They come with a cord ready to hang.  The air plants attach with a small wire.  I will send instructions on how to keep your amazing air plant thriving.  The hanging air plants also make wonderfully sea worthy ornaments.\n\nI hand throw a closed form. I carve and add details when it is leather hard and cut it from the base. I paint it with underglaze and then bisque fire it. It is then glazed with a clear glaze and high fired. It is durable and it is food safe. I never have lead in any of my glazes.\n\nCollect a pod of these delightful,dangling sea creatures. We have squid , octopus and jellyfish in many colors to choose from. A great way to start a care free octopus garden with a lot of whimsy.  Makes a great gift as well.  Why send flowers?  When you can send a unique, live plant.\n\n\n Air plants are easy to take care of and they do not need to be planted.  They thrive at the office, at home, in a bright bathroom, even on sheltered porches.   They like bright, filtered light, avoid direct sunlight.  They like good air circulation.  The like humid climates, and should be soaked 2-3 times a week, spray between soakings.  The like the temp to be between 45*-95*.  Use 1/4 strength orchid fertilizer once a month from Mar-October.\n\nStart your octopus garden! \n\nAll designs, descriptions, photos, and creative contents are copyrighted Â© by  Cindy and James Searles  2014-2015. All rights reserved.\n\n\n\nAir Plants can not fly over seas, or to Alaska or Hawaii.  Priority mail must be chosen for shipments anywhere beyond CA---excluding international purchases.\n\nhttps://www.etsy.com/listing/229249824/air-plant-necklace-octopus-wearable Check out our new wearable octopus air plant necklaces.\n\nHip Hip Hooray!  Your purchase has been fired by the sun.  Our kilns and studios are solar powered.\n\n&quot;Like&quot; us on facebook and see what life is like in Occidental, CA.\nhttps://www.facebook.com/CindySearlesCeramics\n\n\nwww.cindysearles.com\n\n\nhttps://www.etsy.com/your/shops/CindySearles/sections/15082603 for a complete selection of planters.\n\nwww.etsy.com/your/shops/CindySearles/sections/15327291",
