"title": "Coastal Home style art prints",
"announcement": "****FREE Shipping Worldwide on 5x7, 8x10 & 14x11 inch prints (initial despatch)****\r\nBring summer into your home all year round with our lovely coastal home style art prints.  ",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Thank you for your order.  Your item will ship very soon and we&#39;ll send you a message via the Etsy Convo system with details of the date that your item will be despatched, usually within 1 working day of your order being made.\r\n\r\nAll of our 5x7, 8x10 and 14x11inch prints have free standard shipping on initial despatch.  Estimates for delivery with Standard Shipping are below.  If your purchase has Fedex International Priority Shipping, then these wont apply.  It will be a lot faster.  A LOT faster!  \r\n\r\nStandard shipping is UNTRACKED\r\n===========================\r\n\r\n**** STANDARD SHIPPING DELIVERY TIMES ****\r\nUK - 2/3 days.  Most UK orders are sent 1st Class.\r\nEU Europe - Normally 5-10 working days, but please allow at least 2 weeks.\r\nUSA / Canada / Australia / Western Europe - Please allow at least 3weeks for delivery.  In some cases it can take up to 4weeks for an item to be delivered.\r\nOther areas of the world -  please expect delivery in 3 to 4 weeks.\r\n\r\nYou can phone us on 01903 240249 if you are in the UK, or 44 1903 240249 from overseas for an update.  Or you can email us at fab(at)fabfunky.com",
"digital_sale_message": null,
"last_updated_tsz": 1432144785,
"listing_active_count": 214,
"login_name": "fabfunky3",
"accepts_custom_requests": false,
"policy_welcome": "Hello and welcome to the NauticalNell shop. Our art prints are designed to bring a splash of nautical beauty to your home, and a smile to your face.  ",
"policy_payment": "Full payment must be made in full at the time of purchase.",
"policy_shipping": "We&#39;ll ship your prints within 2-3 working days of your payment clearing. Please remember that our packages do not fit in most mail boxes.\r\n\r\n******FREE Shipping Worldwide on all 5x7 8x10 & 14x11 inch prints****** \r\nAll 5x7, 8x10 & 14x11 inch prints are offered with free international shipping (initial shipping)\r\n\r\nSTANDARD SHIPPING:\r\nOur standard postage is not a signed for service and tracking is not available. Your prints are shipped from UK.\r\n\r\nDelivery is generally quite quick but your customs may delay this, so please allow up to 28 days for your delivery.  Average delivery times are as follows but please bear in mind that it might take a little longer during busy times (Christmas!):\r\n\r\nUK - Delivery in 2/3 working days. UK orders are generally sent 1st Class.\r\nEU Europe - Normally 5-10 working days, but please allow at least 2 weeks.\r\nUSA / Canada / Australia / Western Europe - Please allow at least 3weeks for delivery.  Delivery is generally within 14-20 days\r\nOther areas of the world - The average is 18 days, but please allow up to 4weeks for delivery.\r\n\r\nThe buyer is responsible for any duties and/or customs fees that may be incurred by their destination country.\r\n\r\n\r\nFEDEX INTERNATIONAL PRIORITY:\r\nSome of our items have free Fedex International Priority Shipping included - check your item description for details.\r\nAll of our customers in the US and Canada have the option to upgrade shipping to a Federal Express Priority service which is fully tracked.  You will be emailed the tracking details via the FedEx system.  \r\n\r\nThe estimated shipping day period is from when your order is dispatched by us, not from when you place your order.  But don&#39;t worry, we know that you want your items as fast as possible and so we will make every effort to dispatch within 1/2 days.",
"policy_refunds": "All prints are 100% returnable for the full purchase price within 30 days of shipping date. We cannot refund postage, and you&#39;ll be liable to any charges incurred if you return any goods to us.\r\n\r\nWe can&#39;t consider a refund on any missing prints until at least 20 business days have passed. That&#39;s four weeks from shipping date. Please remember that our packages do not fit in most mail boxes, so check with your postal carrier if you think something has not arrived when it should have.\r\n\r\nIf we hear from you that you wish to cancel an order, any sum debited to us from your credit or debit card will be re-credited to that credit or debit account within 14 days of your notice of cancellation of your order.\r\n\r\nIf your order is returned to us by the postal service as they were unable to deliver it, then we will be happy to ship your order again however you will have to pay the shipping costs again.",
"policy_additional": "NauticalNell is a trading name of FabFunky Ltd, a registered company trading in the UK. All items, images and artwork is copywrite owned by FabFunky. Please note, all of our artwork and associated copywrite details are legally registered prior to publication. You can find the FabFunky shop on Etsy ofering great Dictionary Art, and other other shop LoopyLolly offering slightly loopy art prints.\r\n\r\nImages may not be used in a commercial capacity unless permission has been sought and agreed in advance with NauticalNell / FabFunky or one of our agents.",
