"title": "Octopus Art Print, Octopus Illustration, Kraken on a Raging Sea Poster, Wall Art, Beach House Decor, Nautical Man Cave Decor, Gift For Dad",
"description": "Extraordinary octopus art print, also known as a Kraken, attacking a merchant ship, reproduced from an 1802 french illustration. This giant octopus is the stuff that centuries old Norwegian sagas are made of.\n\nI love this print. It is a great conversation piece. &quot;My life is like the ship in that poster&quot; or, &quot;I woke up feeling like the Kraken today&quot;. I feel for the Kraken. It has its tentacles full of what it wanted, but isn&#39;t quite sure how to proceed - or if it really and truly wanted an entire merchant vessel in the first place.\n\nThough I have carefully selected all of my papers to give the best results for the works I offer, I highly recommend the watercolor for this print. It is a 100% cotton rag, heavy weight paper that offers excellent detail and rich color and in addition, lends to the vintage feel of this piece.\n \nIf you would like to see this print in a gallery wrapped canvas print, go here:\nhttps://www.etsy.com/listing/199496489/kraken-canvas-print-wall-hanging-kraken?ref=shop_home_active_1\n\nTo view all of the prints and posters at Adam&#39;s Ale Art Prints, please follow this link: https://www.etsy.com/shop/AdamsAleArtPrints\n\nSPECIAL\nBuy 3 Get 1 Free - Please do not purchase fourth item (or you will be purchasing fourth item). Please let me know in the notes to seller at checkout which print you want for your free fourth.\n\nA POST PURCHASE OFFER\nGo to my Facebook page (https://www.facebook.com/adamsaleartprints), like and post a picture of your Adam&#39;s Ale print after you&#39;ve hung it and I will send you a free 8 x 10 of your choice. Message me here to let me know you have posted your print and give me the address to send your print. Don&#39;t forget to let me know which print you want and which paper to \nuse.\n\nMETHOD\nAdam&#39;s Ale art prints are made using a 12 color process fine art printer to insure the most vivid, detailed and long lasting prints. In addition, you can automatically customize your print by choosing from four different paper types during checkout. \n\nPAPER DESCRIPTIONS\nAll papers are heavyweight, acid free museum quality papers.\nMatte: This paper is a smooth, non-glare paper. The finish is soft and well defined.\nWatercolor: This is a textured cotton paper that lends a vintage feel to the prints.\nIf you have anymore questions, please message me.\n\nPRINT LAYOUT\nIf you are ordering prints with wording or captions, the captions for all prints fall within the area measurement of the print(s) that you are purchasing. If you prefer your captions outside of the area so that only the art of the print fills the area (captions will still be there but on the outside of the area) please let me know in the message to seller box at checkout. Thanks!\n\nPRINT BACKGROUNDS\nIf you see prints that you like but aren&#39;t sure the backgrounds will match, message me in your message to seller at checkout that you want all of your backgrounds to match and I will do that. Print set backgrounds match.\n\nPACKAGING AND SHIPPING\nAll prints are sealed in cellophane and mailed in a sturdy cardboard rectangle box that withstands up to 200 pounds of pressure, a sturdy tube, or a cardboard envelope with chipboard reinforcement. Your print will arrive safe or I will replace it.\n\nNEW SIZES AND STRETCHED CANVAS PRINTS\nAdam&#39;s Ale Art Prints now offers print sizes up to 44&quot; wide and canvas prints. Please message if you are interested.\n\nSO YOU DON&#39;T GET DISAPPOINTED\nMats and frames are not included.\n\nSO YOU DON&#39;T WORRY\nAny watermarks shown in listing photos will not be on your print. \n\nTHANK YOU!\nThank you for visiting my shop and taking the time to read all of this info. If you have any questions I didn&#39;t cover, please message my. I reply within 24 hours and more often than not within 3 hours - unless it&#39;s during the sleeping hours.\n\nÂ© AdamsAleArtPrints. All Rights Reserved.",
