"title": "Ernst Haeckel and Nautical Art Prints and Posters",
"announcement": "Adam&#39;s Ale offers nautical art, botanical, natural history and Ernst Haeckel art prints & posters that make perfect home decor solutions for nature lovers, scientists, history buffs, art versus nature philosopher types, or anyone who appreciates beautiful, well-made, intelligent and interesting vintage style art and decor. \r\n\r\nADAM&#39;S ALE&#39;S FIFTEEN MINUTES OF FAME\r\nKeep a look out for Adam&#39;s Ale prints on the sets of the DIY channel Man Caves show, Bravo Channel&#39;s Kourtney and KhloÃ© Take The Hamptons, and Grace and Frankie, a Netflix original scheduled for 2015.\r\n\r\nADAM&#39;S ALE&#39;S SPECIALS\r\nSPECIAL: Buy 3 Get 1 Free*  Buy 3 individual prints and get one individual print free or buy 3 sets and get one set free.\r\n*Please do not purchase fourth item (or you will be purchasing fourth item). Please copy and paste the title of the free fourth print you want and put it in the notes to seller at checkout.\r\n\r\nAND THE GOODIES KEEP ON COMING\r\nLike me at my new Facebook page for special offers and discounts. Like and post your Adam&#39;s Ale print hanging on your wall on my FB page and get a free 8 x 10 print of your choice! https://www.facebook.com/adamsaleartprints\r\n\r\nINTERNATIONAL SHIPPING\r\nPlease note that if you live outside of the US, you may be charged a VAT tax in your country upon receipt of your prints. I have heard this is happening a lot lately. I am required by law to list the items and cost of items on the customs form when it leaves here. This is especially important to keep in mind if you are buying a gift. The goods and the price of the goods will be listed on the shipping label. The person receiving the gift might even be asked to pay taxes on it! I do not add or include the shipping cost on the form. Approximately 20% of the orders I receive are from foreign lands. I appreciate that business and wish that you were not taxed. \r\n\r\nA REQUEST CONCERNING FEEDBACK\r\nI  want for you to be happy with your prints. I have spared no expense getting the best equipment and materials to provide the best prints. There is a lot of competition out there and I intend to stand out. I want you to shop here and come back when you want a decor change or to give somebody a gift that you know will be the best quality. If you are unhappy, please let me know before you give me negative feedback. If you have suggestions for improvement, let me know anytime, whether you are my customer or not.  Negative feedback can damage my business. Unless I am being asked to violate my policies, my principles, or the law, I am willing to work with and appreciate my customers.\r\n\r\nAPPRECIATION\r\nI am glad you are here and I appreciate that you have taken the time to read this.\r\nThank you!\r\n\r\n\r\n\r\n\r\n\r\n ",
"currency_code": "USD",
