"vacation_message": "Hi, thank you for stopping by. I&#39;m not taking orders today (4/23/15) so that I can catch up on orders and get shipments out. I&#39;ll be back tomorrow. I&#39;m still checking messages but am pretty busy so might not be answering them until tomorrow.\r\n\r\nSuzy",
"sale_message": "Thank you for making your purchase at Adam&#39;s Ale Prints. \r\n\r\nA POST PURCHASE OFFER\r\nGo to my Facebook page (https://www.facebook.com/adamsaleartprints), like and post a picture of your Adam&#39;s Ale print after you&#39;ve hung it (please make sure the print is hung or taped or mounted on the wall as opposed to strait out of the envelope and still flat) and I will send you a free 8 x 10 of your choice. Message me here to let me know you have posted your print and give me the address to send your print. Don&#39;t forget to let me know which print you want and which paper to use.\r\n\r\nA REQUEST\r\nI  want for you to be happy with your prints. I have spared no expense getting the best equipment and materials to provide the best prints. There is a lot of competition out there and I intend to stand out. I want you to shop here and come back when you want a decor change or to give somebody a gift that you know will be the best quality. If you feel that you can&#39;t give me a solid 5-star rating, please let me know what I can do to make you feel better about our transaction. \r\n\r\nNegative feedback, or even a rating of less than 5 stars, can damage my business. Unless I am being asked to violate my policies, my principles, or the law, I am willing to work with and appreciate my customers.\r\n\r\nThank you.\r\n \r\n",
