"policy_welcome": "Welcome to Adam&#39;s Ale Art Prints, I am glad you are here! If you don&#39;t see what you are looking for, please let me know. Maybe I can make it - or tell you where to find it. I am in the business of preserving and restoring vintage scientific illustrations so that they can live on in your home, classroom, or office. I like what I do.",
"policy_payment": "Adam&#39;s Ale Art Prints accepts Paypal, echecks, Etsy checkout, and money orders. \r\n\r\n\r\n",
"policy_shipping": "In the US, I ship USPS through Paypal with tracking. Internationally I shop first class.  If you have special requirements, let me know through an Etsy message.\r\n\r\nPlease note that if you live outside of the US, you may be charged a VAT tax in your country upon receipt of your prints. I have heard this is happening a lot lately. I am required by law to list the items and cost of items on the customs form when it leaves here. I do not add or include the shipping cost on the form. Approximately 20% of the orders I receive are from foreign lands. I appreciate that business and wish that you were not taxed.\r\n",
"policy_refunds": "Paper Prints: If you don&#39;t like it, let me know within 5 days after you have received your print, return the prints, in good condition to the return address on your envelope, and I will refund your money. \r\n\r\nCanvas Prints: Please make sure you really want the canvas print.  Please measure your area before purchasing to make sure the size is good for you. These are expensive to make and ship so I am not open to try outs on these.  If you receive your canvas print damaged, it is insured and will be replaced. Message me if you have any questions about your canvas print before you buy it.\r\n\r\nI send the posters and prints in tubes or rigid photo envelopes with an extra piece of chipboard in the middle for reinforcement. If your order arrives bent, despite my efforts to keep them safe, please message me immediately. Take a photo of your damaged package and attach it to your message if possible.  I will send another package to you.\r\n",
"policy_additional": "If you want to know something, or see something that you like, but would like to change something, let me know, I&#39;ll see what I can do.",
